// export default ProfilePage;
// Import React and useState
import React, {useState} from 'react';
import '../styles/pages/ProfileStyle.css';
import Navbar from "../components/Navbar";
import SuccessMessage from "../components/SuccessMessage";

function ProfilePage() {
    const [isEditing, setIsEditing] = useState(false);
    const [userData, setUserData] = useState({
        email: 'b.alramlawi360@gmail.com',
        username: 'ggg',
        userType: 'Regular',
        hourlyRate: '$900',
        isVerified: 'Yes',
    });

    const handleEditClick = () => {
        setIsEditing(true);
    };

    const handleSaveClick = () => {
        setIsEditing(false);
        // Add logic to save updated data here
    };

    const handleInputChange = (e) => {
        const {name, value} = e.target;
        setUserData({
            ...userData,
            [name]: value,
        });
    };

    return (
        <div className="profile-container">
            <Navbar/>
            <SuccessMessage message={"fghfhghgh"}/>
            <div className="profile-card">
                <div className="profile-header">
                    <img
                        src={process.env.PUBLIC_URL + '/profile.png'}
                        alt="ProfilePage"
                        className="profile-image"
                    />
                    <h2 className="profile-title">ProfilePage Information</h2>
                </div>
                <div className="profile-info">
                    <div className="profile-item">
                        <label className="profile-label">Email:</label>
                        {isEditing ? (
                            <input
                                type="text"
                                name="email"
                                value={userData.email}
                                onChange={handleInputChange}
                                className="profile-input"
                            />
                        ) : (
                            <p className="profile-value">{userData.email}</p>
                        )}
                    </div>
                    <div className="profile-item">
                        <label className="profile-label">Username:</label>
                        {isEditing ? (
                            <input
                                type="text"
                                name="username"
                                value={userData.username}
                                onChange={handleInputChange}
                                className="profile-input"
                            />
                        ) : (
                            <p className="profile-value">{userData.username}</p>
                        )}
                    </div>
                    <div className="profile-item">
                        <label className="profile-label">User Type:</label>
                        {isEditing ? (
                            <input
                                type="text"
                                name="userType"
                                value={userData.userType}
                                onChange={handleInputChange}
                                className="profile-input"
                            />
                        ) : (
                            <p className="profile-value">{userData.userType}</p>
                        )}
                    </div>
                    <div className="profile-item">
                        <label className="profile-label">Hourly Rate:</label>
                        {isEditing ? (
                            <input
                                type="text"
                                name="hourlyRate"
                                value={userData.hourlyRate}
                                onChange={handleInputChange}
                                className="profile-input"
                            />
                        ) : (
                            <p className="profile-value">{userData.hourlyRate}</p>
                        )}
                    </div>
                    <div className="profile-item">
                        <label className="profile-label">Verified:</label>
                        {isEditing ? (
                            <input
                                type="text"
                                name="isVerified"
                                value={userData.isVerified}
                                onChange={handleInputChange}
                                className="profile-input"
                            />
                        ) : (
                            <p className="profile-value">{userData.isVerified}</p>
                        )}
                    </div>
                    {isEditing ? (
                        <button
                            className="profile-save-button" // Apply the save button style
                            onClick={handleSaveClick}
                        >
                            Save
                        </button>
                    ) : (
                        <button
                            className="profile-edit-button" // Apply the edit button style
                            onClick={handleEditClick}
                        >
                            Edit
                        </button>
                    )}
                </div>
            </div>
        </div>
    );
}

export default ProfilePage;
